selector_to_html = {"a[href=\"https://en.wikipedia.org/wiki/Mathematical_modelling_of_infectious_disease\"]": "<p>Mathematical models can project how infectious diseases progress to show the likely outcome of an epidemic and help inform public health and plant health interventions. Models use basic assumptions or collected statistics along with mathematics to find parameters for various infectious diseases and use those parameters to calculate the effects of different interventions, like mass vaccination programs. The modelling can help decide which intervention(s) to avoid and which to trial, or can predict future growth patterns, etc.</p>", "a[href^=\"https://en.wikipedia.org/wiki/Mathematical_modelling_of_infectious_disease#\"]": "<p>Mathematical models can project how infectious diseases progress to show the likely outcome of an epidemic and help inform public health and plant health interventions. Models use basic assumptions or collected statistics along with mathematics to find parameters for various infectious diseases and use those parameters to calculate the effects of different interventions, like mass vaccination programs. The modelling can help decide which intervention(s) to avoid and which to trial, or can predict future growth patterns, etc.</p>", "a[href=\"https://en.wikipedia.org/wiki/Compartmental_models_in_epidemiology\"]": "<p><b>Compartmental models</b> are a very general modelling technique. They are often applied to the mathematical modelling of infectious diseases. The population is assigned to compartments with labels \u2013 for example, <b>S</b>, <b>I</b>, or <b>R</b>,. People may progress between compartments. The order of the labels usually shows the flow patterns between the compartments; for example SEIS means susceptible, exposed, infectious, then susceptible again.</p>", "a[href^=\"https://en.wikipedia.org/wiki/Compartmental_models_in_epidemiology#\"]": "<p><b>Compartmental models</b> are a very general modelling technique. They are often applied to the mathematical modelling of infectious diseases. The population is assigned to compartments with labels \u2013 for example, <b>S</b>, <b>I</b>, or <b>R</b>,. People may progress between compartments. The order of the labels usually shows the flow patterns between the compartments; for example SEIS means susceptible, exposed, infectious, then susceptible again.</p>", "a[href=\"#recomendaciones-para-saber-mas\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Recomendaciones para saber m\u00e1s<a class=\"headerlink\" href=\"#recomendaciones-para-saber-mas\" title=\"Link to this heading\">#</a></h2><p>Siga fuentes oficiales de informaci\u00f3n y las recomendaciones de las autoridades\nsanitarias. Y antes de consumir informaci\u00f3n sobre este tema, le recomiendo leer\nlas publicaciones que epidemi\u00f3logos y expertos afines han realizado en una\nforma digerible y divulgativa. Respecto a esto \u00faltimo recomiendo los hilos en\ntwitter de <a class=\"reference external\" href=\"https://twitter.com/ZulmaCucunuba\">Zulma Cucunub\u00e1</a>, epidemi\u00f3loga,\ndoctora en din\u00e1mica de enfermedades infecciosas.</p><p>A nivel de gr\u00e1ficos, es posible que actualice el\n<a class=\"reference external\" href=\"https://www.facebook.com/pg/cosmoscalibur/photos/?tab=album&amp;album_id=2580908872196780\">\u00e1lbum en facebook</a>.</p>", "a[href=\"#ruido-y-desinformacion\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Ruido y desinformaci\u00f3n<a class=\"headerlink\" href=\"#ruido-y-desinformacion\" title=\"Link to this heading\">#</a></h2><p>Esta es la raz\u00f3n de hacer esta publicaci\u00f3n, as\u00ed que empezar\u00e9 con mencionar\nalgunas se\u00f1ales de ruido en medio de esta pandemia y, luego brevemente\ncomentar\u00e9 porque no debe considerarse esa situaci\u00f3n y que si podr\u00edamos decir\nsanamente.</p><p>Ha sido d\u00edas con mucha agitaci\u00f3n en redes con menciones basadas en los datos\npero no revisadas por epidemi\u00f3logos, los expertos a los cuales debemos escuchar\nen medio de esta crisis, sino por \u00abexpertos\u00bb en anal\u00edtica de datos y como les\ngusta en ingl\u00e9s, \u00ab<em>data scientists</em>\u00bb. El porque de las comillas es parte de mi\ncr\u00edtica, y es que no estamos en una situaci\u00f3n que permita salir p\u00fablicamente a\nllenarse el ego de s\u00e9 predecir con modelos de juguetes e impresionar a p\u00fablico\nque no tiene formaci\u00f3n ni en datos ni en epidemiolog\u00eda. \u00bfUsan esos modelos en\nsus trabajos?</p>", "a[href=\"#id1\"]": "<figure class=\"align-center\" id=\"id1\">\n<a class=\"reference internal image-reference\" href=\"../../../../_images/comunicado-covid-colombia-4-abril-2020.png\"><img alt=\"Comunicado gr\u00e1fico de los casos de Covid19 en Colombia del 4 de abril de 2020.\" src=\"../../../../_images/comunicado-covid-colombia-4-abril-2020.png\" style=\"width: 150px; height: 300px;\"/></a>\n<figcaption>\n<p><span class=\"caption-text\">Se resalta la menci\u00f3n de <strong>confirmados</strong> en los comunicados oficiales. En el\nejemplo, comunicado del 5 de abril de 2020.</span><a class=\"headerlink\" href=\"#id1\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#prediccion-y-aplanamiento-de-la-curva\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Predicci\u00f3n y aplanamiento de la curva<a class=\"headerlink\" href=\"#prediccion-y-aplanamiento-de-la-curva\" title=\"Link to this heading\">#</a></h2><p>Si es posible hacer pron\u00f3sticos matem\u00e1ticos sobre la evoluci\u00f3n de la pandemia,\neso es algo claro y es uno de los insumos importantes para tomar decisiones\nsobre las medidas a implementar para controlar su propagaci\u00f3n. Y entonces, \u00bfpor\nqu\u00e9 la cr\u00edtica a mis colegas?</p><p>No est\u00e1n considerando m\u00faltiples variables, las cuales describir\u00e9:</p>", "a[href=\"#datos-y-responsabilidad-covid19\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Datos y responsabilidad: Covid19<a class=\"headerlink\" href=\"#datos-y-responsabilidad-covid19\" title=\"Link to this heading\">#</a></h1><p>Hab\u00eda tratado de estar al margen de hacer muy p\u00fablico lo que pienso y analizo\nde los datos de la pandemia por covid19 en Colombia, y de las medidas tomadas.\nSin embargo, finalmente me motiv\u00e9 a hacer una segunda afirmaci\u00f3n del todo\np\u00fablica (si, ya les contar\u00e9 que fue lo anterior) porque veo algo recurrente en\ncolegas \u00abcient\u00edficos de datos\u00bb (<em>data scientists</em> que se gustan decir en\ningl\u00e9s), donde creen prudente hacer ajustes de curvas b\u00e1sicas y hacer\ninterpretaciones del futuro y observaciones sin contexto del fen\u00f3meno.</p>", "a[href=\"#referencias\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Referencias<a class=\"headerlink\" href=\"#referencias\" title=\"Link to this heading\">#</a></h2>", "a[href=\"#subestimacion-de-los-datos\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Subestimaci\u00f3n de los datos<a class=\"headerlink\" href=\"#subestimacion-de-los-datos\" title=\"Link to this heading\">#</a></h2><p>Una de las cosas m\u00e1s importantes al iniciar a revisar la informaci\u00f3n de los\ncasos de covid19 en todo el mundo, es la menci\u00f3n a \u00abCasos positivos\nconfirmados\u00bb. Y aqu\u00ed, <strong>confirmados</strong> es la clave.</p>", "a[href=\"#conceptos\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Conceptos<a class=\"headerlink\" href=\"#conceptos\" title=\"Link to this heading\">#</a></h2><p>Generalmente los comportamientos de crecimientos de poblaci\u00f3n o de la\npropagaci\u00f3n en poblaciones se modelan con comportamientos de tipo exponencial,\ngausianas y log\u00edsticas (si, igual las otras tienen exponenciales por dentro).</p><p>Normalmente nos encontramos que la manera como interactuamos con las personas\ny manteniendo el trazado de la interacci\u00f3n de estas, lleva a consolidar el\nn\u00famero de personas con interacci\u00f3n directa e indirecta con el crecimiento\nexponencial (<span class=\"math notranslate nohighlight\">\\(A\\exp(r t)\\)</span>, donde <span class=\"math notranslate nohighlight\">\\(r\\)</span> es la tasa de crecimiento y\n<span class=\"math notranslate nohighlight\">\\(A\\)</span> es la poblaci\u00f3n inicial afectada).</p>", "a[href=\"#id2\"]": "<figure class=\"align-center\" id=\"id2\">\n<img alt=\"Casos acumulados de Covid19 al 4 de abril de 2020 por tipo en Colombia.\" src=\"../../../../_images/casos-covid-colombia-tipo-4-abril-2020.png\"/>\n<figcaption>\n<p><span class=\"caption-text\">Acumulado de casos positivos confirmados de covid19 por tipolog\u00eda incluyendo\nel total. La curva azul presenta crecimiento exponencial.</span><a class=\"headerlink\" href=\"#id2\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
